import Drink from "./Drink";

export default function DrinkList({drinks, mixologists, onUpdateDrink, onDeleteDrink}){

  const renderDrinks = 
        drinks.map(drink => (
          <Drink 
            key={drink.id} 
            drink={drink} 
            onUpdateDrink={onUpdateDrink}
            onDeleteDrink={onDeleteDrink}
            mixologists={mixologists}
          />
        ))

  return(
    <div >
      {renderDrinks}
    </div>
  )
}
